               // Found: return the stored index (it->second) and current index (i)\n                return {it->second, i};\n            }\n\n            // Store the current number and its index\n            map[currentNum] = i;\n        }\n\n        // Problem statement guarantees one solution, but throw if not found.\n        throw std::runtime_error("No two sum solution found.");\n        // return {}; // Alternative: return empty vector\n    }\n};\n\n// Example Usage:\nint main() {\n    Solution sol;\n    std::vector<int> nums1 = {2, 7, 11, 15};\n    int target1 = 9;\n    std::vector<int> result1 = sol.twoSum(nums1, target1);\n    std::cout << "Input: " << nums1 << ", Target: " << target1\n              << ", Indices: " << result1 << std::endl; // Output: [0, 1]\n\n    std::vector<int> nums2 = {3, 2, 4};\n    int target2 = 6;\n    std::vector<int> result2 = sol.twoSum(nums2, target2);\n    std::cout << "Input: " << nums2 << ", Target: " << target2\n              << ", Indices: " << result2 << std::endl; // Output: [1, 2]\n\n    return 0;\n}\n'}),(0,c.jsx)(fu,{sx:{my:3}}),(0,c.jsx)(Gi,{variant:"subtitle1",gutterBottom:!0,children:"Algorithm Analysis (Hash Map)"}),(0,c.jsxs)(Gi,{variant:"body2",color:"text.secondary",children:[(0,c.jsx)("strong",{children:"Time Complexity:"})," ",(0,c.jsx)("code",{children:"O(N)"}),". We iterate through the array once. Hash map lookups and insertions are O(1) on average."]}),(0,c.jsxs)(Gi,{variant:"body2",color:"text.secondary",sx:{mt:.5},children:[(0,c.jsx)("strong",{children:"Space Complexity:"})," ",(0,c.jsx)("code",{children:"O(N)"}),". In the worst case, we store N elements in the hash map."]})]}),controls:(0,c.jsxs)(c.Fragment,{children:[(0,c.jsx)(Gi,{variant:"subtitle1",sx:{textAlign:"center",fontWeight:"bold",p:.75,mb:2.5,borderRadius:"4px",color:"common.white",background:"linear-gradient(45deg, #4CAF50 30%, #81C784 90%)",boxShadow:1},children:"Algorithm Visualizer"}),(0,c.jsxs)(xd,{container:!0,spacing:1.5,alignItems:"c