    // Dimensions are m x n (rows x columns)\n    const dp = Array(m).fill(0).map(() => Array(n).fill(0));\n\n    // Base cases: First row (only move right)\n    for (let j = 0; j < n; j++) {\n        dp[0][j] = 1;\n    }\n    // Base cases: First column (only move down)\n    for (let i = 0; i < m; i++) {\n        dp[i][0] = 1;\n    }\n\n    // Fill the rest of the grid\n    for (let i = 1; i < m; i++) {\n        for (let j = 1; j < n; j++) {\n            // Ways to reach (i, j) = ways from top + ways from left\n            dp[i][j] = dp[i - 1][j] + dp[i][j - 1];\n        }\n    }\n\n    // Result is in the bottom-right cell\n    return dp[m - 1][n - 1];\n};\n\n// Example Usage:\nconsole.log(uniquePaths(3, 7)); // Output: 28\nconsole.log(uniquePaths(3, 2)); // Output: 3\nconsole.log(uniquePaths(1, 1)); // Output: 1\n",language:"javascript"}),(0,c.jsx)(Gi,{variant:"subtitle2",sx:{mt:2,mb:.5},children:"Python:"}),(0,c.jsx)(Nm,{codeString:'\nclass Solution:\n    """\n    Calculates the number of unique paths in an m x n grid (down or right moves).\n    Uses O(m * n) time and O(m * n) space DP (can be optimized).\n    """\n    def uniquePaths(self, m: int, n: int) -> int:\n        if m <= 0 or n <= 0:\n            return 0\n\n        # dp[i][j] = number of ways to reach cell (row i, col j)\n        dp = [[0] * n for _ in range(m)]\n\n        # Base cases: Initialize first row and first column to 1\n        for j in range(n):\n            dp[0][j] = 1\n        for i in range(m):\n            dp[i][0] = 1\n\n        # Fill the grid using the recurrence relation\n        for i in range(1, m):\n            for j in range(1, n):\n                # Paths to (i, j) = paths from (i-1, j) + paths from (i, j-1)\n                dp[i][j] = dp[i-1][j] + dp[i][j-1]\n\n        # Result is at the bottom-right corner\n        return dp[m-1][n-1]\n\n# Example Usage:\nif __name__ == "__main__":\n    sol = Solution()\n    print(f"uniquePaths(3, 7) = {sol.uniquePaths(3, 7)}") # Output: 28\n    print(f"uniquePaths(3, 2) = {sol.uniquePaths(3, 2)}") # Output: 3\n    print(f"uniquePaths(1, 1) = {sol.uniquePaths(1, 1)}") # Output: 1\n',language:"python"}),(0,c.jsx)(Gi,{variant:"subtitle2",sx:{mt:2,mb:.5},children:"Java:"}),(0,c.jsx)(Nm,{codeString:'\nclass Solution {\n    /**\n     * Calculates the number of unique paths in an m x n grid (down or right moves).\n     * Uses O(m * n) time and O(m * n) space DP.\n     * @param m Number of rows.\n     * @param n Number of columns.\n     * @return The number of unique paths.\n     */\n    public int uniquePaths(int m, int n) {\n        if (m <= 0 || n <= 0) return 0;\n\n        // dp[i][j] = number of ways to reach cell (i, j)\n        int[][] dp = new int[m][n];\n\n        // Base cases: Fill first row and first column with 1s\n        for (int j = 0; j < n; j++) {\n            dp[0][j] = 1;\n        }\n        for (int i = 0; i < m; i++) {\n            dp[i][0] = 1;\n        }\n\n        // Fill the rest of the DP table\n        for (int i = 1; i < m; i++) {\n            for (int j = 1; j < n; j++) {\n                dp[i][j] = dp[i - 1][j] + dp[i][j - 1]; // Sum of paths from top and left\n            }\n        }\n\n        // The result is at the bottom-right cell\n        return dp[m - 1][n - 1];\n    }\n\n    // Example Usage:\n    public static void main(String[] args) {\n        Solution sol = new Solution();\n        System.out.println("uniquePaths(3, 7) = " + sol.uniquePaths(3, 7)); // Output: 28\n        System.out.println("uniquePaths(3, 2) = " + sol.uniquePaths(3, 2)); // Output: 3\n        System.out.println("uniquePaths(1, 1) = " + sol.uniquePaths(1, 1)); // Output: 1\n    }\n}\n',language:"java"}),(0,c.jsx)(Gi,{variant:"subtitle2",sx:{mt:2,mb:.5},children:"C++:"}),(0,c.jsx)(Nm,{codeString:'\n#include <vector>\n#include <iostream>\n\nclass Solution {\npublic:\n    /**\n     * Calculates the number of unique paths in an m x n grid (down or right moves).\n     * Uses O(m * n) time and O(m * n) space DP.\n     * @param m Number of rows.\n     * @param n Number of columns.\n     * @return The number of unique paths.\n     */\n    int uniquePaths(int m, int n) {\n        if (m <= 0 || n <= 0) return 0;\n\n        // dp[i][j] = number of ways to reach cell (i, j)\n        // Initialize grid with 0s\n        std::vector<std::vector<int>> dp(m, std::vector<int>(n, 0));\n\n        // Base cases: Fill first row and column with 1s\n        for (int j = 0; j < n; ++j) {\n            dp[0][j] = 1;\n        }\n        for (int i = 0; i < m; ++i) {\n            dp[i][0] = 1;\n        }\n\n        // Fill the rest of the grid\n        for (int i = 1; i < m; ++i) {\n            for (int j = 1; j < n; ++j) {\n                dp[i][j] = dp[i - 1][j] + dp[i][j - 1]; // Paths from top + paths from left\n            }\n        }\n\n        // Result is in the bottom-right cell\n        return dp[m - 1][n - 1];\n    }\n};\n\n// Example Usage:\nint main() {\n    Solution sol;\n    std::cout << "uniquePaths(3, 7) = " << sol.uniquePaths(3, 7) << std::endl; // Output: 28\n    std::cout << "uniquePaths(3, 2) = " << sol.uniquePaths(3, 2) << std::endl; // Output: 3\n    std::cout << "uniquePaths(1, 1) = " << sol.uniquePaths(1, 1) << std::endl; // Output: 1\n    return 0;\n}\n',language:"cpp"}),(0,c.jsx)(fu,{sx:{my:3}}),(0,c.jsx)(Gi,{variant:"subtitle1",gutterBottom:!0,children:"Algorithm Analysis (DP)"}),(0,c.jsxs)(Gi,{variant:"body2",color:"text.secondary",children:[(0,c.jsx)("strong",{children:"Time Complexity:"})," ",(0,c.jsx)("code",{children:"O(M * N)"})," - We fill each cell of the M x N grid once."]}),(0,c.jsxs)(Gi,{variant:"body2",color:"text.secondary",sx:{mt:.5},children:[(0,c.jsx)("strong",{children:"Space Complexity:"})," ",(0,c.jsx)("code",{children:"O(M * N)"})," - For the DP grid. Can be optimized to O(min(M, N))."]})]}),controls:(0,c.jsxs)(c.Fragment,{children:[(0,c.jsx)(Gi,{variant:"subtitle1",sx:{textAlign:"center",fontWeight:"bold",p:.75,mb:2.5,borderRadius:"4px",co