HalfMinHeap.sort((a, b) => a - b); // Keep sorted ascending\n        }\n\n        // 3. Rebalance sizes: Ensure heaps differ by at most 1\n        // If lower half is too big\n        if (this.lowerHalfMaxHeap.length > this.upperHalfMinHeap.length + 1) {\n             const maxOfLower = this.lowerHalfMaxHeap.shift(); // Remove max\n             this.upperHalfMinHeap.push(maxOfLower);\n             this.upperHalfMinHeap.sort((a, b) => a - b);\n        }\n        // If upper half is too big\n        else if (this.upperHalfMinHeap.length > this.lowerHalfMaxHeap.length) {\n             const minOfUpper = this.upperHalfMinHeap.shift(); // Remove min\n             this.lowerHalfMaxHeap.push(minOfUpper);\n             this.lowerHalfMaxHeap.sort((a, b) => b - a);\n        }\n    }\n\n    /**\n     * Returns the median of current data stream. O(1).\n     * @return {number}\n     */\n    findMedian() {\n        const lowerSize = this.lowerHalfMaxHeap.length;\n        const upperSize = this.upperHalfMinHeap.length;\n\n        if (lowerSize > upperSize) {\n            // Odd number of elements, median is top of lower half (max-heap)\n            return this.lowerHalfMaxHeap[0];\n        } else if (upperSize > lowerSize) {\n             // Should not happen with the rebalancing logic above, but included for completeness\n             return this.upperHalfMinHeap[0];\n        } else { // lowerSize === upperSize\n            // Even number of elements, median is average of tops of both heaps\n            if (lowerSize === 0) return 0; // Or throw error for empty stream\n            return (this.lowerHalfMaxHeap[0] + this.upperHalfMinHeap[0]) / 2.0;\n        }\n    }\n}\n\n/**\n * Your MedianFinder object will be instantiated and called as such:\n * var obj = new MedianFinder()\n * obj.addNum(num)\n * var param_2 = obj.findMedian()\n */\n",language:"javascript"}),(0,c.jsx)(Gi,{variant:"subtitle2",sx:{mt:2,mb:.5},children:"Python (heapq):"}),(0,c.jsx)(Nm,{codeString:'\nimport heapq\n\nclass MedianFinder:\n    """\n    Uses two heaps (min-heap and max-heap) to find the median efficiently.\n    Time: addNum O(log N), findMedian O(1). Space: O(N).\n    """\n    def __init__(self):\n        # Max-heap for the lower half (store negative values for max-heap simulation)\n        self.lower_half_max_heap = []  # Stores smaller numbers\n        # Min-heap for the upper half\n        self.upper_half_min_heap = []  # Stores larger numbers\n\n    def addNum(self, num: int) -> None:\n        # Add to max-heap (lower half) initially\n        # Push negative value to simulate max-heap with heapq (which is min-heap)\n        heapq.heappush(self.lower_half_max_heap, -num)\n\n        # Ensure largest in lower <= smallest in upper\n        # Move the largest element from lower_half to upper_half\n        if (self.lower_half_max_heap and self.upper_half_min_heap and\n                (-self.lower_half_max_heap[0] > self.upper_half_min_heap[0])):\n            val = -heapq.heappop(self.lower_half_max_heap)\n            heapq.heappush(self.upper_half_min_heap, val)\n\n        # Balance the sizes of the two heaps\n        # Lower half can have at most one more element than upper half\n        if len(self.lower_half_max_heap) > len(self.upper_half_min_heap) + 1:\n            val = -heapq.heappop(self.lower_half_max_heap)\n            heapq.heappush(self.upper_half_min_heap, val)\n        elif len(self.upper_half_min_heap) > len(self.lower_half_max_heap):\n            val = heapq.heappop(self.upper_half_min_heap)\n            heapq.heappush(self.lower_half_max_heap, -val)\n\n    def findMedian(self) -> float:\n        lower_size = len(self.lower_half_max_heap)\n        upper_size = len(self.upper_half_min_heap)\n\n        if lower_size > upper_size:\n            # Odd number of elements, median is the top of the max-heap (negated)\n            return -self.lower_half_max_heap[0]\n        elif upper_size > lower_size:\n             # This case shouldn\'t happen with the 